import React, { Component } from 'react';
//import { BrowserRouter, Route, Switch } from 'react-router-dom';
import PropTypes from 'prop-types';

//import { createBrowserHistory } from 'history';

import { ReactDadata } from 'react-dadata';
import { Button } from 'react-bootstrap';

import { connect } from 'react-redux';
//import { createCompanies } from './actions/users';

class App extends Component {

  componentWillMount() {
    //this.props.fetchData('https://titangro.mocklab.io/users/')
    fetch("https://suggestions.dadata.ru/suggestions/api/4_1/rs/suggest/party", {
      method: 'POST',
      mode: 'cors',
      credentials: 'same-origin',
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json',
        'Authorization': 'Token 6692478bebb2ef311e5137c8a7f03b26f98aeb72'
      },
      body: JSON.stringify({
        query: 'сбербанк'
      })
    })
      .then(res => res.json())
      .then(res => console.log(res))
  }  

  render() {
    return (
      <React.Fragment>
        <ReactDadata token="6692478bebb2ef311e5137c8a7f03b26f98aeb72" query="Москва" placeholder="" />
        <Button bsPrefix="super-btn" variant="primary">кнопка</Button>
      </React.Fragment>      
    )
    //const history = createBrowserHistory();
    /*return (      
      <BrowserRouter basename={process.env.PUBLIC_URL}>
        <div className="container" >
          <Switch>
            <Route exact path="/">
              <UserList {...this.props} />
            </Route>
            <Route path="/users/:userId" history={history}>
              <Profile {...this.props} />
            </Route>
          </Switch>
          <Slider {...this.props} />      
        </div>
      </BrowserRouter>
    )*/
  }
}

const mapStateToProps = (state) => {
  return {
      error: state.error,
      loading: state.loading,
      users: state.users,
      user: state.user
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    //fetchData: (url) => dispatch(createUsers(url))
  };
};

App.propTypes = {
  children: PropTypes.node
};

export default connect(mapStateToProps, mapDispatchToProps)(App);
